import React, { Component } from 'react'
import { withRouter } from 'react-router-dom'
import "./global.css"
import WalletConnector from './WalletConnector'

class NavBar extends Component {
  render() {
    const GotoExchange = withRouter(({ history }) => (
      <button className="btn btn-contained mx-4 text-sm"
        onClick={() => { history.push('/exchange') }}
      >
        Exchange
      </button>
    ))
    const GotoHome = withRouter(({ history }) => (
      <button className="btn btn-contained mx-4 text-sm"
        onClick={() => { history.push('/') }}
      >
        Transfer
      </button>
    ))

    return (
      <div className="flex absolute w-full bg-blue-500">
        <div className="inline-flex flex-grow m-2 items-center">
          <h6 className="text-white font-bold m-2">Deez Token Trader</h6>
          <GotoHome/>
          <GotoExchange/>
          <WalletConnector handleConnect={this.props.handleConnect}/>
        </div>
      </div>
    )
  }
}

export default NavBar
